import React from "react";
import classes from "./cart.module.css";
import classes2 from "./modal.module.css";
import ReactDOM from "react-dom";

function ItemShopCS() {
  <React.Fragment>
    <div className={classes["cart-item"]}>
      <li></li>
    </div>
    <div className={classes.action}>
      <button>-</button>
      <button>+</button>
    </div>
    <div className={classes.total}>
      <h2>Total:</h2>
    </div>
  </React.Fragment>;
}

function Backdrop() {
  return (
    <React.Fragment>
      <div className={classes2.backdrop}></div>
      <div className={classes2.modal}></div>
    </React.Fragment>
  );
}

export default function ItemShop(props) {
  return (
    <React.Fragment>
      {ReactDOM.createPortal(
        <ItemShopCS />,
        document.getElementById("Shop")
      )}
      {ReactDOM.createPortal(
        <Backdrop />,
        document.getElementById("backdrop")
      )}
    </React.Fragment>
  );
}
